import React from "react";
import styled from 'styled-components'

const Header = (props) => {

  const HeaderWrap = styled.div`
    background: pink;
  `;

  const Container = styled.div`
    max-width: 900px;
    margin: 0 auto;
    position: relative;
    h1 {
      margin: 0;
    }
  `;

  return (
    <HeaderWrap>
      <Container>
        <h1>{props.title}</h1>
        <ul>
          <li>
            <span>Inventory</span>
          </li>
          <li>
            <span>Available</span>
          </li>
        </ul>
      </Container>
    </HeaderWrap>
  )
}

export default Header;
